        price: 40,
    },
    {
        id: 'm2',
        name: 'Vada',
        description: 'Exquisite taste!',
        price: 30,
    },
    {
        id: 'm3',
        name: 'Idly',
        description: 'As smooth as cotton.',
        price: 30,
    },
    {
        id: 'm4',
        name: 'Poori',
        description: 'A tasty delight.',
        price: 40,
    },
];

const AvailableMeals=()=>{
    const mealsList=DUMMY_MEALS.map(meal=><li>{meal.name}</li>)
    return <section className={classes.meals}>
        <ul>
            {mealsList}
        </ul>
    </section>

}


export default AvailableMeals
